import React, { Component } from "react";
import { MDBContainer, MDBRow, MDBCol,MDBBadge } from "mdbreact";
import DocsLink from "./../components/docsLink";

class more extends Component {
  state = {
    modal: false
  }

  toggle = () => {
    this.setState({
      modal: !this.state.modal
    });
  }

  render() {
    return (
      <MDBContainer className="mt-1">

        <MDBRow>
          <MDBCol md="5">
            
          <img src={require('../assets/6.jpg')} style={{ maxWidth:"100%",height:"100%",width:"100%" }}/>
          </MDBCol>
          <MDBCol md="7" style={{paddingTop: "30px"}}>
    
                <h3 className="text-center">
                Oversized Textured Top  
                </h3>
            
          </MDBCol>
        </MDBRow>
      </MDBContainer>
    );
  }
}

export default more;
